import React from 'react'

const RecipeList = (props) =>{
    console.log('props in Recipe list ->', props)
    console.log("[0] :", props.recipes[0])
    const recipeList = props.recipes.map((recipe) =>{

        return (
            <div key={recipe.id}>

                <span>{recipe.title}</span>
                <img src={recipe.image} alt={recipe.title}/>
                <span>{recipe.ingredients}</span>
            </div>
        )
    })
    const ingredientList = props.ingredients.map((ingredient) => {
        return(
            <div key={ingredient.id}>
                <span>{ingredient.original}</span>
            </div>
        )
    })
    const instructions = props.instructions.map((instruction) => {
        return(

                <li key={instruction.id}>{instruction.number} {instruction.step}</li>

        )
    })
    return(
        <div>
            {recipeList}
            {ingredientList}
            <br/>
            <ul>
            {instructions}
            </ul>
        </div>
    )
}

export default RecipeList
